import React from "react"
import User from "./User"

class Users extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            users: [
                {
                    id: 1,
                    firstname: 'Bob',
                    lastname: 'Marley',
                    age: 40,
                    isHappy: true
                },
                {
                    id: 2,
                    firstname: 'John',
                    lastname: 'Doe',
                    age: 22,
                    isHappy: false   
                }
            ]
        }
    }

    render() {
        if(this.state.users.length > 0)
            return (<div>
                {this.state.users.map((el) => (
                    <User />
                ))}
            </div>)
        else
        return (<div className="user"> 
            <h3>Пользователей нет</h3>
        </div>)
    }
}

export default Users
